import { Container, ListItem, ListItemText, makeStyles } from "@material-ui/core"
import data from "../../assets/listTask/list.json"
import { useDispatch } from "react-redux"
import { FixedSizeList } from 'react-window'

const useStyles = makeStyles({

})

const renderRow = (props, classes) => {
    const { index, style } = props
    return(
        <ListItem>
            <ListItemText button style={style} key={index}>
                <Container>{data[index].title}</Container>
            </ListItemText>
        </ListItem>
    )
}

function ListCardTask(){
    const classes = useStyles()
    const dispatch = useDispatch()

    return(
        <Container>
            <FixedSizeList
                height={600} 
                width={800} 
                itemSize={46} 
                itemCount={3} 
            >
                {(props) => renderRow(props, classes, dispatch)}
            </FixedSizeList>
        </Container>
    )
}
export default ListCardTask
